<?php

namespace Tests\Feature\Repository\Registration;

use App\Models\Admin\Registration\EORegistration;
use App\Models\User;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Illuminate\Foundation\Testing\WithFaker;
use Illuminate\Foundation\Testing\WithoutMiddleware;
use Tests\TestCase;

class EventOrganizerRegistrationTest extends TestCase
{
    private $eoRegistrationRepository;

    use WithFaker;
    use WithoutMiddleware;
   
    public function setUp(): void {

        parent::setUp();

        $this->eoRegistrationRepository = $this->app->make("App\Repository\Registration\EventOrganizerRegistrationRepository");
        
    }

    /**
     * @return void
     */
    public function test_register_new_eo_using_valid_data(): void {

        $this->withoutExceptionHandling();

        $response = $this->withSession(['banned' => false])->post(
            route('eo.registration.store'), [
            "q30_namaEvent" => "Kejurnas-" . $this->faker->name(),
            "q301_email" => $this->faker->safeEmail,
            "q112_tempatPenyelenggaraan" => $this->faker->city(),
            "q113_tanggalPenyelenggaraan" => $this->faker->date,
            "q117_name117" => [
                0 => "Mobil",
                1 => "Motor",
                2 => "Go-Kart",
                "other" => "Perahu",
            ],
            "q118_klasifikasiPerlombaan" => "Internasional",
            "q119_keteranganSingkat" => "wwejwkejkwjekwjewewjeewewewewsaasasasa",
            "q124_typeA" => '[{"Nama":"Iyan","Alamat":"jl. jalan","Pekerjaan":"nganggur","No. KTA":"1213223"}]',
            "q150_tandaTangan" => "data:image/png;base64,",
            "q125_ketuaPenyelenggara" => '[{"Nama":"Ucok","Alamat":"jl. jalan","Pekerjaan":"nganggur","No. KTA":"1232224","No. Anggota IMI Jabar/Klub":"23232323","No. TKT":"43434343","No. Lisensi":"23243212"}]',
            "q151_tandaTangan151" =>  "data:image/png;base64,",
            "q126_petugasScrutineering" => '[{"Nama":"Ucok","Alamat":"jl. jalan","Pekerjaan":"bolang","No. KTA":"23244","No. Lisensi":"233232"}]',
            "q152_signature152" => 'data:image/png;base64,',
            "q138_sponsorTunggal" => "PT. Djarum",
            "q139_sponsorUtama139" => "PT. MYA",
            "q137_sponsordonaturLainnya" => "Pt ptan\nPt indomie",
            "q142_kelasYang142" => "easy\nmedium\nhard",
            "q143_penghargaan" => "duit\ntrophy", 
        ]);

        $response->assertOk();
    }

     /**
     * @return void
     */
    public function test_cannot_register_new_eo_using_invalid_data(): void {

        $this->withoutExceptionHandling();

        $response = $this->withSession(['banned' => false])->post(
            route('eo.registration.store'), [
            "q30_namaEvent" => null,
            "q301_email" => $this->faker->safeEmail,
            "q112_tempatPenyelenggaraan" => $this->faker->city(),
            "q113_tanggalPenyelenggaraan" => $this->faker->date,
            "q117_name117" => [
                0 => "Mobil",
                1 => "Motor",
                2 => "Go-Kart",
                "other" => "Perahu",
            ],
            "q118_klasifikasiPerlombaan" => "",
            "q119_keteranganSingkat" => "wwejwkejkwjekwjewewjeewewewewsaasasasa",
            "q124_typeA" => '[{"Nama":"Iyan","Alamat":"jl. jalan","Pekerjaan":"nganggur","No. KTA":"1213223"}]',
            "q150_tandaTangan" => "data:image/png;base64,",
            "q125_ketuaPenyelenggara" => '[{"Nama":"Ucok","Alamat":"jl. jalan","Pekerjaan":"nganggur","No. KTA":"1232224","No. Anggota IMI Jabar/Klub":"23232323","No. TKT":"43434343","No. Lisensi":"23243212"}]',
            "q151_tandaTangan151" =>  "data:image/png;base64,",
            "q126_petugasScrutineering" => '[{"Nama":"Ucok","Alamat":"jl. jalan","Pekerjaan":"bolang","No. KTA":"23244","No. Lisensi":"233232"}]',
            "q152_signature152" => 'data:image/png;base64,',
            "q138_sponsorTunggal" => "PT. Djarum",
            "q139_sponsorUtama139" => "PT. MYA",
            "q137_sponsordonaturLainnya" => "Pt ptan\nPt indomie",
            "q142_kelasYang142" => "easy\nmedium\nhard",
            "q143_penghargaan" => "duit\ntrophy", 
        ]);

        $response->assertRedirect("http://localhost");
    }

    public function test_can_export_registered_eo(): void {

        $this->withoutExceptionHandling();

        $user = User::find(1);

        $data = EORegistration::select('id')->orderBy('created_at', 'DESC')->first();

        $response = $this->actingAs($user, 'web')
        ->withSession(['banned' => false])
        ->get("admin/registration/event/registrant/$data->id/export");
 
        $response->assertStatus(200);
    }

    public function test_can_delete_registered_eo(): void {

        $data = EORegistration::select('id')->orderBy('created_at', 'DESC')->first();

        $response = $this->eoRegistrationRepository->deleteData($data->id);

        $this->assertTrue($response);
    }
}
